import React, { useState } from 'react';
import PolicyData_Temp from './PolicyData_Temp';
import { useNavigate } from 'react-router-dom';
import './CustomPolicySearch.css';

const CustomPolicySearch = () => {
    const navigate = useNavigate();
    const [selectedAge, setSelectedAge] = useState(20); // 기본 나이
    const [selectedCategory, setSelectedCategory] = useState('주거지원형'); // 기본 카테고리
    const [selectedGroup, setSelectedGroup] = useState(null); // 집단 버튼 선택
    const [selectedFeature, setSelectedFeature] = useState(null); // 세부 기능 버튼 선택

    const groups = [
        '전문대생', '대학생', '취준생',
        '사회초년생', '중소기업재직', '청년창업',
        '고졸', '차상위계층', '자립준비청년', '대학원생',
    ];

    const features = [
        '마감된 것도 보여주세요', '하나의 기능',
        '두개의 기능', '세개의 기능',
    ];

    // 필터링된 정책 데이터
    const filteredPolicies = PolicyData_Temp.filter(
        (policy) =>
            policy.age >= selectedAge &&
            policy.age <= 25 &&
            policy.category === selectedCategory
    );

    return (
        <div className="custom-policy-container">
            <header className="custom-policy-header">
                <h1>맞춤 정책찾기</h1>
            </header>

            {/* 나이 선택 */}
            <div className="input-group">
                <label htmlFor="age-select">나이를 알려주세요</label>
                <select
                    id="age-select"
                    value={selectedAge}
                    onChange={(e) => setSelectedAge(parseInt(e.target.value))}
                >
                    {[20, 21, 22, 23, 24, 25].map((age) => (
                        <option key={age} value={age}>
                            {age}세
                        </option>
                    ))}
                </select>
            </div>

            {/* 집단 버튼 */}
            <div className="group-buttons">
                <p>소속되신 집단에 표시해주세요</p>
                <div className="buttons">
                    {groups.map((group) => (
                        <button
                            key={group}
                            className={`group-button ${selectedGroup === group ? 'selected' : ''}`}
                            onClick={() => setSelectedGroup(group)}
                        >
                            {group}
                        </button>
                    ))}
                </div>
            </div>

            {/* 카테고리 선택 */}
            <div className="input-group">
                <label htmlFor="category-select">정책 카테고리를 설정해주세요</label>
                <select
                    id="category-select"
                    value={selectedCategory}
                    onChange={(e) => setSelectedCategory(e.target.value)}
                >
                    {['주거지원형', '창업지원형', '기본소득형'].map((category) => (
                        <option key={category} value={category}>
                            {category}
                        </option>
                    ))}
                </select>
            </div>

            {/* 세부 기능 버튼 */}
            <div className="feature-buttons">
                <p>세부기능을 표시해주세요</p>
                <div className="buttons">
                    {features.map((feature) => (
                        <button
                            key={feature}
                            className={`feature-button ${selectedFeature === feature ? 'selected' : ''}`}
                            onClick={() => setSelectedFeature(feature)}
                        >
                            {feature}
                        </button>
                    ))}
                </div>
            </div>

            {/* 필터링된 정책 리스트 */}
            <div className="policy-list">
                {filteredPolicies.length > 0 ? (
                    filteredPolicies.map((policy) => (
                        <div key={policy.id} className="policy-card">
                            <h3>{policy.title}</h3>
                            <p>{policy.description}</p>
                            <img src={policy.image} alt={policy.title} />
                        </div>
                    ))
                ) : (
                    <p>조건에 맞는 정책이 없습니다.</p>
                )}
            </div>

            {/* 완료 버튼 */}
            <button className="complete-button">완료</button>
        </div>
    );
};

export default CustomPolicySearch;
